import Link from "next/link";
import React, { useEffect, useState } from "react";
import Button from "./Button";

const Footer = () => {
  const [links, setLinks] = useState([
    { name: "Home", url: "/" },
    { name: "Live competitions", url: "/live-competitions" },
    { name: "How to play?", url: "/how-to" },
  ]);

  useEffect(() => {
    console.log(links);
  }, []);

  return (
    <div className='mr-4 flex p-4 justify-between bg-gray-100'>
      <div className='flex items-center'>
        <h1 className='mr-8 font-black text-3xl text-secondary '>LOGO</h1>

        {links.map((item) => {
          return (
            <div className='text-primary  tracking-wider text-sm mr-4'>
              <Link href={item.url} key={item.url}>
                {item.name}
              </Link>
            </div>
          );
        })}
      </div>
      <div className='flex items-center'>
        <Button primary style='' url='/sign-up' name='Sign up'></Button>
        <Button secondary style='' url='/login' name='Login'></Button>
      </div>
    </div>
  );
};

export default Footer;
